import "antd/dist/reset.css";
import './assets/scss/App.scss';

//imoprt Route
import { ThemeProvider as CustomThemeProvider } from "./Common/ThemeContext";
import RoutesComponents from "./Routes/index";

export const App = () => {
  return (
    <CustomThemeProvider>
      <RoutesComponents />
    </CustomThemeProvider>
  )
}
